import React, {component} from 'react';
 import {NavLink} from 'react-router-dom'; 
 import {Navbar, Nav} from 'react-bootstrap'; 
 
 export class Navigation extends component{     
     render(){         
         return( 
    <Navbar bg="dark" expands="lg"> 
    <Navbar.Toggle aria-controls="basic-navbar-nav"/> 
    <Navbar.Collapse id="basic-navbar-nav"> 
    <Nav> 
        <NavLink className="d-inline p-z bg-dark text-white"  to="/Maincourse">Main Course</NavLink>  
         <NavLink className="d-inline p-z bg-dark text-white" to="/Combooffers">Combo Offers</NavLink>  
         <NavLink className="d-inline p-z bg-dark text-white"  to="/Watermelon">Watermelon</NavLink>                  
         <NavLink className="d-inline p-z bg-dark text-white"  to="/Brownies">Brownies</NavLink>  
    </Nav> 
    </Navbar.Collapse> 
    </Navbar> 
) 
} 
} 
 export default Navigation
